import React from "react";
import { useRouteMatch } from "react-router";

function Users() {
  let match = useRouteMatch();
  return (
    <>
      <strong>
        <p>Users</p>
      </strong>
      <ul>
        <li>
          <a href={`${match.url}/ivanov`}>Ivanov</a>
        </li>
        <li>
          <a href="/users/petrov">Petrov</a>
        </li>
      </ul>
    </>
  );
}

export default Users;
